Contract ^0.8.8/TestContract.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.8;
import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";
contract Test{
    struct Person{
        int256 hello;
    }

    Person public mytest;
    function setMytest(uint256 _val) public{
        (,mytest.hello,,,) =AggregatorV3Interface(0x8A753747A1Fa494EC906cE90E9f37563A8AF630e).latestRoundData();
    }
}

